    background: url('http://i983.photobucket.com/albums/ae314/vhienxiah/o.png')







    bottom right







    #000000







    no-repeat fixed !important;







  }















ol#posts li blockquote,















body.mceContentBody blockquote {







margin-left: 0 !important;







